import logo from '../logo.svg';
import '../App.css';
import Navbar from '../Navbar/Navbar';

function BlogPlantes() {

    return (
      <div className="App">
        <Navbar />
        <div class="mb-6">
                <label for="password" class="block mb-2 text-sm font-medium text-gray-900 dark:text-white">Your password</label>
                <input type="password" id="password" class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-full p-1 md:p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" required/>
            </div>
      </div>
    );
  }
  

export default BlogPlantes;
